import React from 'react';
import Logo from '../../images/belcorp.png'
import styled from 'styled-components';

const NavBar = styled(
  forwardRef(({ theme, ...other }, ref) => <nav {...other} ref={ref} />),
)({
  display: "flex",
  flexDirection: "row",
  flexWrap: "nowrap",
  background: props => (props.theme.primary ? props.theme.primary : "#15317e"),
  color: props => (props.theme.text ? props.theme.text : "white"),
  minHeight: props => (props.theme.height ? props.theme.height + "px" : "50px"),

  "@media (max-width: 768px)": {
    position: "relative",
    flexDirection: "column",
    alignItems: "flex-start",
    minWidth: "200px",
    minHeight: "100%",
  },
})

export const SomosBelcorp = () => {
  return (
    <>
    <nav class="navbar navbar-expand-lg navbar-light bg-light">
      <a class="navbar-brand" href="#"><img src={Logo} alt="logo-belcorp" style="width : 20%"/></a>
      <button class="navbar-toggler" type="button" data-toggle="collapse" data-target="#navbarNavAltMarkup" aria-controls="navbarNavAltMarkup" aria-expanded="false" aria-label="Toggle navigation">
      <span class="navbar-toggler-icon"></span>
      </button>
      <div class="collapse navbar-collapse" id="navbarNavAltMarkup">
        <div class="navbar-nav">
          <a class="nav-item nav-link active" href="#">Home <span class="sr-only">(current)</span></a>
          <a class="nav-item nav-link" href="#">Features</a>
          {/* <a class="nav-item nav-link" href="#">Pricing</a>
          <a class="nav-item nav-link disabled" href="#" tabindex="-1" aria-disabled="true">Disabled</a> */}
        </div>
      </div>
    </nav>

    </>
  )
};
